import React from "react";
import { FaAngleLeft } from "react-icons/fa";
import { Link } from "react-router-dom";
import { Section, Container, Topbar, Cons, ConsTwo } from "./FormOneElements";

function FormOnes() {
  return (
    <Section>
      <Container>
        <Topbar>
          <Cons>
            <Link to="/landing">
              <FaAngleLeft />
            </Link>
          </Cons>
          <ConsTwo>
            <h3>Health Check</h3>
          </ConsTwo>
        </Topbar>
      </Container>
    </Section>
  );
}

export default FormOnes;
